DELIMITER DLM00 
DROP PROCEDURE IF EXISTS coreinit DLM00

CREATE PROCEDURE coreinit()
BEGIN
	declare tenant_id int;
	declare user_id varchar(36);

	IF NOT EXISTS(SELECT 1 FROM tenants_tenants LIMIT 1) THEN
		start transaction;
		select uuid() into user_id;
		select last_insert_id() into tenant_id;
		commit;
	END IF;


	start transaction;
	

	commit; 

	start transaction;
	commit;

	truncate table files_converts;
	start transaction;
	commit;

	start transaction;




	commit;

END DLM00

CALL coreinit() DLM00

DELIMITER ;